import React, { Component } from 'react';
import ProjectDataService from '../service/ProjectDataService';

class ListProjectsComponent extends Component {
    constructor(props){
        super(props)
        this.refreshProjects=this.refreshProjects.bind(this)
    }

    componentDidMount(){
        this.refreshProjects();
    }

    refreshProjects(){
        ProjectDataService.retrieveAllProjects()
        .then(response=>{
                console.log(response);
        })
    }


    render() {
        return (
            <div className="container">
                <h3>All Courses</h3>
                <div className="container">
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Id</th>
                                <th>Description</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>1</td>
                                <td>Learn Full PROJECTSstack with Spring Boot and Angular</td>
                            </tr>
                            <tr>
                                <td>2</td>
                                <td>Learn skskFullPROJECTS stack with Spring Boot and Angular</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}

export default ListProjectsComponent
